import React from "react";
import { Link } from "react-router-dom";
import { TypeAnimation } from "react-type-animation";
import { Typography } from "react-typography";

const Home = () => {
  return (
    <div className="Home">
      <div className="Left">
        <Typography.Speed>
          <Typography.Loop>
            <Typography.Delay ms={1000}>
              <h1>
                <Typography>BEAUTYPLEX</Typography>
              </h1>
            </Typography.Delay>
          </Typography.Loop>
        </Typography.Speed>
        <p className="description">
          Bienvenue dans notre boutique de produits cosmétiques pour vous offrir
          une expérience de beauté incomparable. Découvrez une sélection
          soigneusement choisie pour sublimer votre beauté naturelle.
        </p>

        <br></br>
      </div>
      <div className="Right">
        <img id="product" src="./bioplex.png" alt="bioplex" />
      </div>
    </div>
  );
};

export default Home;
